			shellScript = "# To avoid excess CMake calls (because these take a long time to execute), this script stores the current git description and md5 hash of the repository CMake directory; when available, it compares the stored values to the current values and exits if nothing has changed.\n\ndate\n\nset -e\nset -o xtrace\n\ncd VTK\ndescription=$(git describe --always --tags --dirty)\nhash=$(find -s CMake -type f -exec md5 -q {} \\; | md5)\nshash=$(md5 -q \"$0\")\n\ncmake_dir=\"$PROJECT_TEMP_DIR/VTK.cmake\"\nmkdir -p \"$cmake_dir\"\ncd \"$cmake_dir\"\n\nif [ -e VTK.xcodeproj -a -f .cmakedescription -a -f .cmakehash -a -f .cmakeshash ]; then\n    cmakedescription=$(cat \".cmakedescription\")\n    cmakehash=$(cat \".cmakehash\")\n    cmakeshash=$(cat \".cmakeshash\")\n    if [ \"$cmakedescription\" = \"$description\" -a \"$cmakehash\" = \"$hash\" -a \"$cmakeshash\" = \"$shash\" ]; then\n        date\n        exit 0\n    fi\nfi\n\ncommand -v cmake >/dev/null 2>&1 || { echo >&2 \"error: building VTK requires CMake. Please install CMake. Aborting.\"; exit 1; }\n\nrm -Rf VTK.xcodeproj\necho \"$description\" > .cmakedescription\necho \"$hash\" > .cmakehash\necho \"$shash\" > .cmakeshash\n\ncmake \"$PROJECT_DIR/VTK\" -G Xcode \\\n-DVTK_USE_OFFSCREEN_EGL:BOOL=OFF \\\n-DVTK_USE_X:BOOL=OFF \\\n-DVTK_USE_COCOA:BOOL=OFF \\\n-DBUILD_SHARED_LIBS=OFF \\\n-DCMAKE_OSX_DEPLOYMENT_TARGET=\"$MACOSX_DEPLOYMENT_TARGET\" \\\n-DCMAKE_INSTALL_PREFIX=/usr/local\n\ndate";
